import React from "react";
import Carousel from 'react-bootstrap/Carousel';
import { carouselPicores } from '../data/carouselData';

function StarWarsCarousel() {





  return (
    <Carousel variant="dark" indicators={false} fade={true} keyboard={false}>

{carouselPicores.map((element, key) => <Carousel.Item interval={100} > 
    <img className="b-block w-15"
           src={element.src}
           alt={element.alt} key={key} />

     </Carousel.Item>)}




    </Carousel>
  );
}

export default StarWarsCarousel;
